// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import ReservationForm from './ReservationForm';
import ReservationList from './ReservationList';
import RoomAvailability from './RoomAvailability';
import SummaryDashboard from './SummaryDashboard';
import ExportData from './ExportData';
import HousekeepingMinistryChart from './HousekeepingMinistryChart';
import CleaningTasksList from './CleaningTasksList';
import UpcomingCleaningTasks from './UpcomingCleaningTasks';
import EditReservation from './EditReservation';

// Inline styles for a more advanced look
const pageStyle = {
  margin: '0',
  padding: '0',
  minHeight: '100vh',
  background: 'linear-gradient(120deg, #f0f0f0, #fafafa)',
  fontFamily: 'Arial, sans-serif'
};

const containerStyle = {
  maxWidth: '1200px',
  margin: '0 auto',
  padding: '0 20px'
};

const headerStyle = {
  backgroundColor: '#ffffff',
  borderRadius: '8px',
  padding: '20px',
  marginTop: '20px',
  boxShadow: '0 2px 6px rgba(0,0,0,0.1)'
};

const brandStyle = {
  margin: '0',
  fontSize: '28px',
  fontWeight: 'bold',
  color: '#333'
};

const subTitleStyle = {
  margin: '5px 0 0',
  color: '#666',
  fontSize: '14px'
};

const navContainerStyle = {
  display: 'flex',
  flexWrap: 'wrap',
  gap: '40px',
  marginTop: '20px'
};

const navSectionStyle = {
  flex: '1 1 auto',
  minWidth: '250px',
  backgroundColor: '#ffffff',
  borderRadius: '8px',
  boxShadow: '0 1px 4px rgba(0,0,0,0.1)',
  padding: '20px'
};

const sectionHeaderStyle = {
  margin: '0 0 10px',
  fontSize: '18px',
  fontWeight: 'bold',
  color: '#007BFF'
};

const linkListStyle = {
  listStyle: 'none',
  padding: 0,
  margin: 0
};

const linkItemStyle = {
  marginBottom: '10px'
};

const linkStyle = {
  color: '#007BFF',
  textDecoration: 'none',
  fontSize: '15px'
};

const linkHoverStyle = {
  textDecoration: 'underline'
};

function App() {
  return (
    <Router>
      <div style={pageStyle}>
        <div style={containerStyle}>
          {/* Header / Branding */}
          <header style={headerStyle}>
            <h1 style={brandStyle}>AFC Housekeeping Ministry Dashboard</h1>
            <p style={subTitleStyle}>
              Welcome to the AFC Housekeeping Management System
            </p>
          </header>

          {/* Navigation Sections */}
          <nav style={navContainerStyle}>
            {/* Reservation Management Section */}
            <div style={navSectionStyle}>
              <h3 style={sectionHeaderStyle}>Reservation Management</h3>
              <ul style={linkListStyle}>
                <li style={linkItemStyle}>
                  <Link
                    to="/reservations"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Reservation Management
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/reservation-list"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Reservation List
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/room-availability"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Room Availability
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/summary"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Summary Dashboard
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/export-data"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Export Data
                  </Link>
                </li>
              </ul>
            </div>

            {/* Cleaning schedule and chart Section */}
            <div style={navSectionStyle}>
              <h3 style={sectionHeaderStyle}>Cleaning schedule and chart</h3>
              <ul style={linkListStyle}>
                <li style={linkItemStyle}>
                  <Link
                    to="/"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Housekeeping Ministry Chart
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/cleaning-tasks"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Cleaning Tasks
                  </Link>
                </li>
                <li style={linkItemStyle}>
                  <Link
                    to="/upcoming-tasks"
                    style={linkStyle}
                    onMouseOver={e => e.currentTarget.style.textDecoration = linkHoverStyle.textDecoration}
                    onMouseOut={e => e.currentTarget.style.textDecoration = 'none'}
                  >
                    Upcoming Cleaning Tasks
                  </Link>
                </li>
              </ul>
            </div>
          </nav>

          {/* Routes */}
          <Routes>
            <Route path="/" element={<HousekeepingMinistryChart />} />
            <Route path="/reservations" element={<ReservationForm />} />
            <Route path="/reservation-list" element={<ReservationList />} />
            <Route path="/room-availability" element={<RoomAvailability />} />
            <Route path="/summary" element={<SummaryDashboard />} />
            <Route path="/export-data" element={<ExportData />} />
            <Route path="/cleaning-tasks" element={<CleaningTasksList />} />
            <Route path="/upcoming-tasks" element={<UpcomingCleaningTasks />} />
            <Route path="/edit-reservation/:id" element={<EditReservation />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
